import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Test from './views/test';




function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />}>
          <Route path="test" element={<Test />} />

        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
